import React from "react";
// Font Awesome
import './FontAwesome';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';

function Slider(){
    return(
        <div className="slider">
            <i className="fa fa-angle-left slider-prev" ></i>
            <i className="fa fa-angle-right slider-next"></i>
        </div>
    )
}

export default Slider;
